(39294, '4', '0', 'Thank you for rescuing me, now please aid the rest of my brood!', '12', '0', '100', '0', '0', '0', ''),
(39294, '5', '0', 'The Twilight Dragonkin must be stopped! Rescue the other Red Dragonflight and we shall assist you!', '12', '0', '100', '0', '0', '0', ''),
